script: |
  super -f text -I q5659.spq | sort > q5659.out

inputs:
  - name: q5659.spq
    data: |
      SELECT - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE ( + col2 * + ( - col0 ) * + 30 / + col1 + 12 + + ( - col1 ) ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q5659.out
    data: |
      -10
      -47
      -99
